import {View, Text, FlatList} from 'react-native'
import styles from './styles'
import cars from './cars'
import CarItem from '../CarItem'

const CarsList = () => {
    return(
        <View>
            <FlatList
                data={cars}
            renderItem={({item}) => <CarItem car={item}/>}
            />
        </View>
    )
}

export default CarsList
